        <style type="text/css">
            body {
                background-color:{{TERMBACKGROUND}};

                padding-top:20px;

            .termoutline {
                border: 1px solid #1882d6;
            }
            .termoutline .termheader {
                background-color:white;
                padding:5px;
            }
            .termbody {
                height:calc(90vh - 60px);
                background-color:black;
                overflow:auto;
            }
            .termbody .termcontent {
                padding:10px;
                white-space:pre;
                font-family: monospace, Helvetica, Arial, sans-serif;
                font-size:10pt;
                line-height:1;
                color:#c6c3c6;
            }

            @media (max-width: 768px) {
                .container {
                    padding:5px 5px 0px 5px;
                }
                .termbody {
                    height: calc(100vh - 50px);
                }
            }
        </style>
